import React, { useState } from 'react'
import Member from '../components/Member'

const MemberList = () => {

    const [members, setMembers] = useState([]);
    return (
        <div>
            <h1>회원리스트 페이지</h1>
            {
                members.map(member => <Member key={member.id} member={member} />)
            }
        </div>
    )
}

export default MemberList
